import React from 'react'



const Ul = styled.ul`
ul{
    list-style:none;
    display:flex;
    flex-flow:row nowrap;

li{
    padding:18px;
}
}
`
function RightNav() {
    return (
        <div>
             <ul>
            <li>HOME</li>
            <li>BUY A COURSE</li>
            <li>EXPLORE COURSE</li>
            <li>LOGIN</li>
            <li>CREATE ACCOUNT</li>
        </ul>
        </div>
    )
}

export default RightNav
